import logo from "./logo.svg";
import "./App.css";
import { useState } from "react";

function Card() {
  const [list, setList] = useState([{ id: 1, title: "react를 배워봅시다" }]);
  return (
    <div className="cards">
      {list.map((title) => {
        return (
          <Card>
            list={list} key={list.id}
          </Card>
        );
      })}
    </div>
  );
}

function App(props) {
  let [insert, setInsert] = useState("");
  let addListHandler = () => {
    // let newList = {
    //   id:
    // }

    return (
      <>
        <div className="insertplace">
          <input
            value={insert}
            placeholder="무엇을 할까요?"
            onChange={(e) => setInsert(e.target.value)}
          />
          <button onClick={addListHandler}>추가하기</button>
        </div>
        <h1 className="App">Todo List</h1>;
        <Card />
      </>
    );
  };
}
export default App;
